import React from 'react';
import './DashboardPage.css';
import { NavLink } from 'react-router-dom';
const DashboardPage=()=>{
    return(
        <>
            <div className='container-fluid'>
                <div className='row'>
                    <div className='col-12 menu'>
                        <nav>
                            <ul>
                                <li><NavLink to={''}></NavLink></li>
                            </ul>
                        </nav>
                    </div>
                </div>
            </div>
        </>
    )
}
export default DashboardPage
